import React from 'react';
import Logo from '../Home/Header/Logo';
import Search from '../Home/Header/Search';
import Account from '../Home/Header/Account';
import Cart from '../Home/Header/Cart';
import Tieude from '../Home/tieude/Tieude';
import Footer from '../Home/Foooter/Footer';

function YourCart(props) {
    let { login, buySach } = props;
    console.log(buySach);
    return (
        <>
            {/* code cho nut like share facebook  */}
            <div id="fb-root" />
            {/* header */}
            <nav className="navbar navbar-expand-md bg-white navbar-light">
                <div className="container">
                    {/* logo  */}
                    <Logo></Logo>

                    {/* navbar-toggler  */}

                    <div className="collapse navbar-collapse" id="collapsibleNavId">
                        {/* form tìm kiếm  */}
                        <Search></Search>
                        {/* ô đăng nhập đăng ký giỏ hàng trên header  */}
                        <ul className="navbar-nav mb-1 ml-auto">
                            <Account login={login}></Account>
                            <Cart></Cart>
                        </ul>
                    </div>
                </div>
            </nav>
            {/* form dang ky khi click vao button tren header*/}


            <section className="duoinavbar">
                <Tieude></Tieude>
            </section>
            {/* giao diện giỏ hàng  */}
            <section style={{ minHeight: "520px" }}>
                <div><h1 style={{ textAlign: "center" }}>Giỏ Hàng của bạn chưa có Sản Phẩm Nào</h1></div>
            </section>


            <Footer></Footer>
        </>

    )
}

export default YourCart
